// actions.js

// Action type
export const SET_MESSAGE = 'SET_MESSAGE';

// Action creator to set message
export const setMessage = (message) => {
  return {
    type: SET_MESSAGE,
    payload: message,
  };
};

// Example of a Redux action to set parsed PDF data
export const setParsedPdfData = (data) => {
  return {
    type: 'SET_PARSED_PDF_DATA',
    payload: data,
  };
};
